import SignUp from "../SignUp/SingUp";
import SignIn from "../SignIn/SignInContainer";
import SignOut from "../SignOut/SignOutContainer";
import Navbar from "../Navbar";
import Chat from "../Chat";
import Blog from "../Blog";

import React, { Component } from 'react';
import { BrowserRouter, Route } from "react-router-dom";


export default class Router extends Component {
  render() {
    return (
      <BrowserRouter>
        <Navbar />
        {!this.props.user.isAuth && <Route path="/signIn" exact component={SignIn}></Route>}
        {!this.props.user.isAuth ? <Route path="/signUp" exact component={SignUp}></Route> : <div>{this.props.user.login}</div>}
        {/* <Route path="/signOut" exact component={SignOut}></Route> */}
        <Route path="/chat" exact component={Chat}></Route>
        <Route path="/blog" exact component={Blog}></Route>
      </BrowserRouter>
    )
  }
}
